import React from "react";
import { SafeAreaView, View, Text, Image, TouchableOpacity, StyleSheet, ScrollView } from "react-native";
import { COLORS, SIZES, FONTS, icons, images } from "../constants";

const User = ({ navigation }) => {
    // Sample user data
    const user = {
        name: "Juan Dela Cruz",
        profilePic: images.profilePic, // Replace with actual image source
        profileLimits: "Basic",
        linkedAccounts: [
            { type: "Bank Account", value: "**** 1234" },
            { type: "Paypal", value: "example@paypal.com" }
        ],
        qrCodes: "View QR Code",
        nfcTag: "View NFC Tag",
        juanByteScore: "1234",
        isBetaFeature: true
    };

    function renderHeader() {
        return (
            <View style={styles.header}>
                <TouchableOpacity
                    style={styles.iconButton}
                    onPress={() => navigation.goBack()}
                >
                    <Image
                        source={icons.back}
                        style={styles.icon}
                    />
                </TouchableOpacity>

                <View style={styles.titleContainer}>
                    <Text style={styles.title}>Profile</Text>
                </View>

                <TouchableOpacity
                    style={styles.iconButton}
                    onPress={() => console.log("Settings")}
                >
                    <Image
                        source={icons.settings}
                        style={styles.icon}
                    />
                </TouchableOpacity>
            </View>
        );
    }

    function renderProfile() {
        return (
            <View style={styles.profileContainer}>
                <Image source={user.profilePic} style={styles.profilePic} />
                <Text style={styles.userName}>{user.name}</Text>
                <TouchableOpacity style={styles.button} onPress={() => console.log("View Profile")}>
                    <Text style={styles.buttonText}>View Profile</Text>
                </TouchableOpacity>
            </View>
        );
    }

    function renderFeatureCard(title, content, onPress) {
        return (
            <TouchableOpacity style={styles.featureCard} onPress={onPress}>
                <View style={styles.featureCardContent}>
                    <Text style={styles.featureCardTitle}>{title}</Text>
                    <Text style={styles.featureCardDescription}>{content}</Text>
                </View>
                <Image source={icons.arrowRight} style={styles.arrowIcon} />
            </TouchableOpacity>
        );
    }

    function renderProfileLimits() {
        return renderFeatureCard(
            "Profile Limits",
            user.profileLimits,
            () => console.log("Profile Limits Details")
        );
    }

    function renderLinkedAccounts() {
        const linkedAccountsContent = user.linkedAccounts.map((account, index) => (
            <Text key={index} style={styles.featureCardDescription}>
                {account.type}: {account.value}
            </Text>
        ));
        return renderFeatureCard(
            "Linked Accounts",
            linkedAccountsContent,
            () => console.log("Linked Accounts Details")
        );
    }

    function renderQrCodes() {
        return renderFeatureCard(
            "My QR Codes",
            user.qrCodes,
            () => console.log("View QR Code")
        );
    }

    function renderNfcTag() {
        return renderFeatureCard(
            "NFC Tag Linked",
            user.nfcTag,
            () => console.log("View NFC Tag")
        );
    }

    function renderJuanByteScore() {
        return renderFeatureCard(
            "JuanByte Score",
            user.juanByteScore,
            () => console.log("JuanByte Score Details")
        );
    }

    function renderBetaFeatures() {
        return (
            user.isBetaFeature && (
                <TouchableOpacity style={styles.featureCard} onPress={() => console.log("Verify Account")}>
                    <View style={styles.featureCardContent}>
                        <Text style={styles.featureCardTitle}>Verify Account (Beta)</Text>
                    </View>
                    <Image source={icons.arrowRight} style={styles.arrowIcon} />
                </TouchableOpacity>
            )
        );
    }

    return (
        <SafeAreaView style={styles.container}>
            {renderHeader()}
            <ScrollView contentContainerStyle={styles.scrollContainer}>
                {renderProfile()}
                {renderProfileLimits()}
                {renderLinkedAccounts()}
                {renderQrCodes()}
                {renderNfcTag()}
                {renderJuanByteScore()}
                {renderBetaFeatures()}
            </ScrollView>
        </SafeAreaView>
    );
};

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: COLORS.white,
    },
    header: {
        flexDirection: 'row',
        marginVertical: SIZES.padding * 4,
        paddingHorizontal: SIZES.padding * 3,
        alignItems: 'center',
    },
    iconButton: {
        width: 45,
        alignItems: 'center',
        justifyContent: 'center',
    },
    icon: {
        height: 20,
        width: 20,
        tintColor: COLORS.black,
    },
    titleContainer: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
    },
    title: {
        color: COLORS.black,
        ...FONTS.h3,
    },
    profileContainer: {
        alignItems: 'center',
        marginVertical: SIZES.padding * 2,
    },
    profilePic: {
        width: 100,
        height: 100,
        borderRadius: 50,
        borderWidth: 2,
        borderColor: COLORS.primary,
        marginBottom: SIZES.base,
    },
    userName: {
        ...FONTS.h2,
        color: COLORS.black,
        marginBottom: SIZES.base,
    },
    button: {
        backgroundColor: COLORS.primary,
        paddingVertical: SIZES.base,
        paddingHorizontal: SIZES.padding * 2,
        borderRadius: 10,
        alignItems: 'center',
    },
    buttonText: {
        color: COLORS.white,
        ...FONTS.h4,
    },
    featureCard: {
        flexDirection: 'row',
        alignItems: 'center',
        backgroundColor: COLORS.lightGray,
        marginVertical: SIZES.base,
        padding: SIZES.padding,
        borderRadius: 10,
        shadowColor: "#000",
        shadowOffset: { width: 0, height: 3 },
        shadowOpacity: 0.27,
        shadowRadius: 4.65,
        elevation: 6,
    },
    featureCardContent: {
        flex: 1,
    },
    featureCardTitle: {
        ...FONTS.h4,
        color: COLORS.black,
    },
    featureCardDescription: {
        ...FONTS.body4,
        color: COLORS.gray,
    },
    arrowIcon: {
        height: 15,
        width: 15,
        tintColor: COLORS.black,
    },
    scrollContainer: {
        paddingHorizontal: SIZES.padding * 3,
        paddingBottom: SIZES.padding * 5,
    },
});

export default User;
